import {Link} from 'react-router-dom';
import React, {useEffect, useState} from 'react';
function Nav(){
    const [status, setStatus] = useState([]);

    useEffect( () => {
        fetch('http://localhost:4000/fbstatus') 
            .then(res => {
                return res.json();
            }).catch((error) => {
                alert('error with server ask for help')
            })
            .then(data => {
                setStatus(data)
            })
    }, []);
    return(

        <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
            <div class="container">
            <Link to="/" className="navbar-brand">UOSU Foodbank Order</Link>

            <button class= "navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navmenu">
                <span class="navbar-toggler-icon"></span>
            </button>

                <div class="collapse navbar-collapse" id="navmenu">
                    <ul class="navbar-nav ms-auto">
                        <li class= "nav-item ">
                         <Link to="/Sadmin" className='navbar-brand'>Admin Sign-in</Link>
                        </li>
                        <li class= "nav-item ">
                         <Link to="/Svolun" className='navbar-brand'>Volunteer Sign-in</Link>
                        </li>
                        <li class= "nav-item">
                         <button to="/Sclient" class="btn">Form</button>
                        </li>
                    </ul>
                </div>
            </div>

        </nav>
    );
}

export default Nav;
